
program test_18level
	use settings
	implicit none
	integer,parameter :: neq=324 !Number of equations
	double precision :: x0, xend, tic,toc, rwork(20+neq), delta(2), dummy1(50), dummy3
	double complex :: y0(neq), zwork(15*neq)
	integer :: istate, iwork(30), n, m, dummy2(33), dummy4(8), ticr, tocr, clockrate
	integer :: percentDone = 0
	double complex, dimension(:, :), allocatable :: results
	common /ZVOD01/ dummy1, dummy2
	common /ZVOD02/ dummy3, dummy4
	external :: obedot
	Character(len=6) :: filedescriptor
!$OMP THREADPRIVATE(/ZVOD01/, /ZVOD02/)
	
	call loadSettings()
	
	write (*, *) 'running with B=', bfield
	
	allocate(results(NCoupling, NProbe))
	
	call system_clock(ticr)
	call CPU_TIME(tic)
!$OMP PARALLEL DO DEFAULT(PRIVATE) SHARED(results, Nprobe, Ncoupling, ShiftProbe, ShiftCoupling, StepProbe, StepCoupling, percentDone)
	do n = 1, NProbe
	delta(1) = ShiftProbe + StepProbe*(n - 1)
	!write (*, *) 'running calcualation for dp = ', delta(1)
	do m=1, NCoupling
		delta(2) = ShiftCoupling + StepCoupling*(m - 1)
		! initialise work arrays
		rwork = 0.0d0
		iwork = 0
		iwork(6) = 5000 ! increase maximum number of steps allowed
		
		! initial conditions for OBE
		y0 = cmplx(0.0d0, 0.0d0)
		y0(1) = cmplx(0.2d0, 0.0d0)
		y0(20)= cmplx(0.2d0, 0.0d0)
		y0(39)= cmplx(0.2d0, 0.0d0)
		y0(58)= cmplx(0.2d0, 0.0d0)
		y0(77)= cmplx(0.2d0, 0.0d0)
		x0 = 0.0d0
		xend = 3.5d0
		istate = 1
		call zvode(obedot, neq, y0, x0, xend, 1, 1.d-8, 1.d-8, 1, istate, 1, zwork, 15*neq, rwork, 20+neq, iwork, 30, obedot, 10, delta, 0)
		results(m, n) = 1.d0/dsqrt(2.d0)*(y0(26) + y0(45)) + 1.d0/dsqrt(3.d0)*(y0(7) + y0(64))
		! for plus-minus I should look at y(7), y(26), y(45), y(64)
		! with coefficients 1/root3, 1/root2, 1/root2, 1/root3
	end do
!$OMP ATOMIC
	percentDone = percentDone + 1
	WRITE(*, '(f5.1 a)') REAL(percentDone)/REAL(NProbe)*100, '% done'
	end do
!$OMP END PARALLEL DO
	call CPU_TIME(toc)
	call system_clock(tocr, clockrate)
	!Solver Statistics
	write(*, *) 'execution took ', INT((toc-tic)/60), 'minutes of CPU time'
	write(*, *) 'execution took ', (tocr-ticr)/clockrate/60, 'real-time minutes'
	
	write(filedescriptor, "(F6.2)") bfield
	write(*, *) filedescriptor
	write(*, *) '../results/B'//filedescriptor
	open(15, file='../results/B'//filedescriptor//'.txt')
	do n = 1, NCoupling
		write(15, *) AIMAG(results(n, :))
	end do
	close(15)
	
	deallocate(results)
	
end program

subroutine obedot(neq, t, y, dydt, delta, dummy)
	use settings
	implicit none
	integer, intent(in) :: neq, dummy
	double precision, intent(in) :: t
	double complex, intent(in) :: y(neq)
	double complex, intent(out) :: dydt(neq)
	double precision, intent(in) :: delta(2)
	double precision :: dp, dc
	complex, parameter :: j = cmplx(0, 1)
	double precision, parameter :: uB = 1.4d0
	double precision, parameter :: root2 = dsqrt(2.d0)
	double precision, parameter :: root3 = dsqrt(3.d0)
	double precision, parameter :: root5 = dsqrt(5.d0)
	double precision, parameter :: root6 = dsqrt(6.d0)
	double precision, parameter :: root10 = dsqrt(10.d0)
	double precision, parameter :: root15 = dsqrt(15.d0)
	double precision, parameter :: root30 = dsqrt(30.d0)
	dp = delta(1)
	dc = delta(2)
	
	dydt(1) = 1.d0/108.d0*(5.d0*Gr1*(y(191) + y(210) + y(229)) + 15.d0*Gr2*(y(248) + y(267) + y(286) + y(305) + y(324)) - 18.d0*j*root3*Wp*(-y(109) + y(7)) + 18.d0*G5p*(y(115) + 2.d0*y(96)))
	dydt(2) = 1.d0/12.d0*(2.d0*j*root3*Wp*y(110) + 6.d0*j*BField*uB*y(2) - 3.d0*j*root2*Wp*y(8) + G5p*(root6*y(116) + 2.d0*y(97)))
	dydt(3) = 1.d0/12.d0*(2.d0*j*root3*Wp*y(111) + root6*G5p*y(117) + 12.d0*j*BField*uB*y(3) - 3.d0*j*root2*Wp*y(9))
	dydt(4) = 1.d0/6.d0*(-j*root3*Wp*(y(10) - y(112)) + 9.d0*j*BField*uB*y(4) + G5p*(y(118) - y(99)))
	dydt(5) = 1.d0/6.d0*j*(2.d0*j*G5p*y(100) + root3*Wp*y(113) + 12.d0*BField*uB*y(5))
	dydt(6) = 1.d0/6.d0*(j*root3*Wp*y(114) - (-6*j*dp + 6.d0*gp + 3.d0*G5p + 2.d0*j*BField*uB)*y(6))
	dydt(7) = 1.d0/6.d0*(j*root3*(-Wp*y(1) + Wp*y(115) + Wc2*y(14)) + (6.d0*j*dp - 6.d0*gp - 3.d0*G5p + 2.d0*j*BField*uB)*y(7))
	dydt(8) = 1.d0/60.d0*(3.d0*j*root2*(root5*Wc1*y(11) + 5.d0*Wc2*y(15)) - 5.d0*j*Wp*(-2*root3*y(116) + 3.d0*root2*y(2)) - 30.d0*(G5p - 2.d0*j*(dp + j*gp + BField*uB))*y(8))
	dydt(9) = 1.d0/60.d0*j*(10.d0*root3*Wp*y(117) + 3.d0*root30*Wc1*y(12) + 15.d0*root2*Wc2*y(16) - 15.d0*root2*Wp*y(3) + 10.d0*(6.d0*dp + 6.d0*j*gp + 3.d0*j*G5p + 10.d0*BField*uB)*y(9))
	dydt(10) = 1.d0/30.d0*j*(5.d0*(6.d0*dp + 6.d0*j*gp + 3.d0*j*G5p + 14.d0*BField*uB)*y(10) + root3*(5.d0*Wp*y(118) + 3.d0*root5*Wc1*y(13) + 5.d0*Wc2*y(17) - 5.d0*Wp*y(4)))
	dydt(11) = 1.d0/120.d0*j*(15.d0*(8.d0*(dc + dp + j*gc + j*gp) + 4.d0*j*Gr1 - 5.d0*hfs + 4.d0*BField*uB)*y(11) + 20.d0*root3*(Wp*y(119) - 3.d0*BField*uB*y(15)) + 6.d0*root10*Wc1*y(8))
	dydt(12) = 1.d0/120.d0*j*(5.d0*(3.d0*(4.d0*j*Gr1 - 5.d0*hfs + 8.d0*(dc + dp + j*gc + j*gp + BField*uB))*y(12) + 4.d0*root3*Wp*y(120) - 24.d0*BField*uB*y(16)) + 6.d0*root30*Wc1*y(9))
	dydt(13) = 1.d0/120.d0*j*(12.d0*root15*Wc1*y(10) + 15.d0*(8.d0*(dc + dp + j*gc + j*gp) + 4.d0*j*Gr1 - 5.d0*hfs + 12.d0*BField*uB)*y(13) + 20.d0*root3*(Wp*y(121) - 3.d0*BField*uB*y(17)))
	dydt(14) = 1.d0/24.d0*j*(4.d0*root3*Wp*y(122) + 3.d0*(4.d0*j*Gr2 + 3.d0*hfs + 8.d0*(dc + dp + j*gc + j*gp + 2.d0*BField*uB))*y(14) + 4.d0*root3*Wc2*y(7))
	dydt(15) = 1.d0/24.d0*j*(-12*root3*BField*uB*y(11) + 4.d0*root3*Wp*y(123) + 3.d0*(8.d0*(dc + dp + j*gc + j*gp) + 4.d0*j*Gr2 + 3.d0*hfs + 12.d0*BField*uB)*y(15) + 6.d0*root2*Wc2*y(8))
	dydt(16) = 1.d0/24.d0*j*(-24*BField*uB*y(12) + 4.d0*root3*Wp*y(124) + 3.d0*(4.d0*j*Gr2 + 3.d0*hfs + 8.d0*(dc + dp + j*gc + j*gp + BField*uB))*y(16) + 6.d0*root2*Wc2*y(9))
	dydt(17) = 1.d0/24.d0*j*(4.d0*root3*Wc2*y(10) + 4.d0*root3*Wp*y(125) - 12.d0*root3*BField*uB*y(13) + 3.d0*(8.d0*(dc + dp + j*gc + j*gp) + 4.d0*j*Gr2 + 3.d0*hfs + 4.d0*BField*uB)*y(17))
	dydt(18) = 1.d0/24.d0*j*(4.d0*root3*Wp*y(126) + 3.d0*(8.d0*(dc + dp + j*gc + j*gp) + 4.d0*j*Gr2 + 3.d0*hfs)*y(18))
	dydt(19) = 1.d0/12.d0*(3.d0*j*root2*Wp*y(127) + G5p*(2.d0*y(114) + root6*y(133)) - 6.d0*j*BField*uB*y(19) - 2.d0*j*root3*Wp*y(25))
	dydt(20) = 1.d0/108.d0*(5.d0*Gr1*(y(191) + y(210) + y(229)) - 27.d0*j*root2*Wp*(-y(128) + y(26)) + 15.d0*Gr2*(y(248) + y(267) + y(286) + y(305) + y(324)) + 9.d0*G5p*(y(115) + 3.d0*y(134) + 2.d0*y(96)))
	dydt(21) = 1.d0/12.d0*(6.d0*j*BField*uB*y(21) - 3.d0*j*root2*Wp*(-y(129) + y(27)) + G5p*(3.d0*y(135) + root6*y(97)))
	dydt(22) = 1.d0/12.d0*(3.d0*j*root2*Wp*y(130) + 12.d0*j*BField*uB*y(22) - 2.d0*j*root3*Wp*y(28) + G5p*(-y(117) + root6*y(136) + root6*y(98)))
	dydt(23) = 1.d0/12.d0*(3.d0*j*root2*Wp*y(131) + 18.d0*j*BField*uB*y(23) + 2.d0*G5p*(-y(118) + y(99)))
	dydt(24) = (j*Wp*y(132))/(2.d0*root2) - 1.d0/6.d0*(-6*j*dp + 6.d0*gp + 3.d0*G5p + 5.d0*j*BField*uB)*y(24)
	dydt(25) = -(1.d0/12.d0)*j*(-3*root2*Wp*y(133) + 2.d0*root3*Wp*y(19) + 2.d0*(-6*dp - 6.d0*j*gp - 3.d0*j*G5p + BField*uB)*y(25) - 2.d0*root3*Wc2*y(32))
	dydt(26) = 1.d0/20.d0*(-10*(2.d0*gp + G5p - j*(2.d0*dp + BField*uB))*y(26) + j*root2*(5.d0*Wp*y(134) - 5.d0*Wp*y(20) + root5*Wc1*y(29) + 5.d0*Wc2*y(33)))
	dydt(27) = 1.d0/60.d0*(10.d0*j*(6.d0*dp + 6.d0*j*gp + 3.d0*j*G5p + 7.d0*BField*uB)*y(27) + 3.d0*j*root2*(5.d0*Wp*y(135) - 5.d0*Wp*y(21) + root15*Wc1*y(30) + 5.d0*Wc2*y(34)))
	dydt(28) = 1.d0/60.d0*(-10*j*root3*Wp*y(22) + j*(15.d0*root2*Wp*y(136) + 10.d0*(6.d0*dp + 6.d0*j*gp + 3.d0*j*G5p + 11.d0*BField*uB)*y(28) + 6.d0*root15*Wc1*y(31) + 10.d0*root3*Wc2*y(35)))
	dydt(29) = 1.d0/40.d0*j*(2.d0*root10*Wc1*y(26) + 5.d0*(2.d0*root2*Wp*y(137) + (8.d0*(dc + dp + j*gc + j*gp) + 4.d0*j*Gr1 - 5.d0*hfs)*y(29) - 4.d0*root3*BField*uB*y(33)))
	dydt(30) = 1.d0/40.d0*j*(2.d0*root30*Wc1*y(27) + 5.d0*(2.d0*root2*Wp*y(138) + (8.d0*(dc + dp + j*gc + j*gp) + 4.d0*j*Gr1 - 5.d0*hfs + 4.d0*BField*uB)*y(30) - 8.d0*BField*uB*y(34)))
	dydt(31) = 1.d0/40.d0*j*(4.d0*root15*Wc1*y(28) + 5.d0*(2.d0*root2*Wp*y(139) + (4.d0*j*Gr1 - 5.d0*hfs + 8.d0*(dc + dp + j*gc + j*gp + BField*uB))*y(31) - 4.d0*root3*BField*uB*y(35)))
	dydt(32) = 1.d0/24.d0*j*(6.d0*root2*Wp*y(140) + 4.d0*root3*Wc2*y(25) + 3.d0*(8.d0*(dc + dp + j*gc + j*gp) + 4.d0*j*Gr2 + 3.d0*hfs + 12.d0*BField*uB)*y(32))
	dydt(33) = 1.d0/8.d0*j*(2.d0*root2*Wp*y(141) + 2.d0*root2*Wc2*y(26) - 4.d0*root3*BField*uB*y(29) + (4.d0*j*Gr2 + 3.d0*hfs + 8.d0*(dc + dp + j*gc + j*gp + BField*uB))*y(33))
	dydt(34) = 1.d0/8.d0*j*(2.d0*root2*Wp*y(142) + 2.d0*root2*Wc2*y(27) - 8.d0*BField*uB*y(30) + (8.d0*(dc + dp + j*gc + j*gp) + 4.d0*j*Gr2 + 3.d0*hfs + 4.d0*BField*uB)*y(34))
	dydt(35) = 1.d0/24.d0*j*(4.d0*root3*Wc2*y(28) + 3.d0*(2.d0*root2*Wp*y(143) - 4.d0*root3*BField*uB*y(31) + (8.d0*(dc + dp + j*gc + j*gp) + 4.d0*j*Gr2 + 3.d0*hfs)*y(35)))
	dydt(36) = 1.d0/8.d0*j*(2.d0*root2*Wp*y(144) + (8.d0*(dc + dp + j*gc + j*gp) + 4.d0*j*Gr2 + 3.d0*hfs - 4.d0*BField*uB)*y(36))
	dydt(37) = 1.d0/12.d0*(3.d0*j*root2*Wp*y(145) + root6*G5p*y(151) - 12.d0*j*BField*uB*y(37) - 2.d0*j*root3*Wp*y(43))
	dydt(38) = 1.d0/12.d0*(G5p*(root6*y(114) + 3.d0*y(152)) - 6.d0*j*BField*uB*y(38) - 3.d0*j*root2*Wp*(-y(146) + y(44)))
	dydt(39) = 1.d0/108.d0*(27.d0*G5p*(y(115) + y(153)) + 5.d0*Gr1*(y(191) + y(210) + y(229)) + 15.d0*Gr2*(y(248) + y(267) + y(286) + y(305) + y(324)) - 27.d0*j*root2*Wp*(-y(147) + y(45)))
	dydt(40) = 1.d0/12.d0*(3.d0*j*root2*Wp*y(148) + G5p*(3.d0*y(116) + root6*y(154)) + 6.d0*j*BField*uB*y(40) - 2.d0*j*root3*Wp*y(46))
	dydt(41) = 1.d0/12.d0*(root6*G5p*y(117) + 3.d0*j*root2*Wp*y(149) + 12.d0*j*BField*uB*y(41))
	dydt(42) = (j*Wp*y(150))/(2.d0*root2) - 1.d0/6.d0*(-6*j*dp + 6.d0*gp + 3.d0*G5p + 8.d0*j*BField*uB)*y(42)
	dydt(43) = -(1.d0/12.d0)*j*(-3*root2*Wp*y(151) + 2.d0*root3*Wp*y(37) + 2.d0*(-6*dp - 6.d0*j*gp - 3.d0*j*G5p + 4.d0*BField*uB)*y(43) - 2.d0*root3*Wc2*y(50))
	dydt(44) = 1.d0/20.d0*(-10*(-2*j*dp + 2.d0*gp + G5p)*y(44) + j*root2*(5.d0*Wp*y(152) - 5.d0*Wp*y(38) + root5*Wc1*y(47) + 5.d0*Wc2*y(51)))
	dydt(45) = 1.d0/60.d0*(10.d0*j*(6.d0*dp + 6.d0*j*gp + 3.d0*j*G5p + 4.d0*BField*uB)*y(45) + 3.d0*j*root2*(5.d0*Wp*y(153) - 5.d0*Wp*y(39) + root15*Wc1*y(48) + 5.d0*Wc2*y(52)))
	dydt(46) = 1.d0/60.d0*(-10*j*root3*Wp*y(40) + j*(15.d0*root2*Wp*y(154) + 10.d0*(6.d0*dp + 6.d0*j*gp + 3.d0*j*G5p + 8.d0*BField*uB)*y(46) + 6.d0*root15*Wc1*y(49) + 10.d0*root3*Wc2*y(53)))
	dydt(47) = 1.d0/40.d0*j*(10.d0*root2*Wp*y(155) + 2.d0*root10*Wc1*y(44) - 5.d0*(-8*(dc + dp) - 8.d0*j*gc - 8.d0*j*gp - 4.d0*j*Gr1 + 5.d0*hfs + 4.d0*BField*uB)*y(47) - 20.d0*root3*BField*uB*y(51))
	dydt(48) = 1.d0/40.d0*j*(2.d0*root30*Wc1*y(45) - 5.d0*(-2*root2*Wp*y(156) + (-8*dc - 8.d0*dp - 8.d0*j*(gc + gp) - 4.d0*j*Gr1 + 5.d0*hfs)*y(48) + 8.d0*BField*uB*y(52)))
	dydt(49) = 1.d0/40.d0*j*(4.d0*root15*Wc1*y(46) + 5.d0*(2.d0*root2*Wp*y(157) + (8.d0*(dc + dp + j*gc + j*gp) + 4.d0*j*Gr1 - 5.d0*hfs + 4.d0*BField*uB)*y(49) - 4.d0*root3*BField*uB*y(53)))
	dydt(50) = 1.d0/24.d0*j*(6.d0*root2*Wp*y(158) + 4.d0*root3*Wc2*y(43) + 3.d0*(4.d0*j*Gr2 + 3.d0*hfs + 8.d0*(dc + dp + j*gc + j*gp + BField*uB))*y(50))
	dydt(51) = 1.d0/8.d0*j*(2.d0*root2*Wp*y(159) + 2.d0*root2*Wc2*y(44) - 4.d0*root3*BField*uB*y(47) + (8.d0*(dc + dp + j*gc + j*gp) + 4.d0*j*Gr2 + 3.d0*hfs + 4.d0*BField*uB)*y(51))
	dydt(52) = 1.d0/8.d0*j*(2.d0*root2*Wp*y(160) + 2.d0*root2*Wc2*y(45) - 8.d0*BField*uB*y(48) + (8.d0*(dc + dp + j*gc + j*gp) + 4.d0*j*Gr2 + 3.d0*hfs)*y(52))
	dydt(53) = 1.d0/24.d0*j*(6.d0*root2*Wp*y(161) + 4.d0*root3*Wc2*y(46) - 12.d0*root3*BField*uB*y(49) + 3.d0*(8.d0*(dc + dp + j*gc + j*gp) + 4.d0*j*Gr2 + 3.d0*hfs - 4.d0*BField*uB)*y(53))
	dydt(54) = 1.d0/8.d0*j*(2.d0*root2*Wp*y(162) + (4.d0*j*Gr2 + 3.d0*hfs + 8.d0*(dc + dp + j*gc + j*gp - BField*uB))*y(54))
	dydt(55) = 1.d0/6.d0*(G5p*(-y(150) + y(169)) - 9.d0*j*BField*uB*y(55) - j*root3*Wp*(-y(163) + y(61)))
	dydt(56) = 1.d0/12.d0*(2.d0*j*root3*Wp*y(164) + G5p*(root6*y(132) - y(151) + root6*y(170)) - 12.d0*j*BField*uB*y(56) - 3.d0*j*root2*Wp*y(62))
	dydt(57) = 1.d0/12.d0*(2.d0*j*root3*Wp*y(165) + G5p*(3.d0*y(133) + root6*y(171)) - 6.d0*j*BField*uB*y(57) - 3.d0*j*root2*Wp*y(63))
	dydt(58) = 1.d0/108.d0*(9.d0*G5p*(3.d0*y(134) + y(153) + 2.d0*y(172)) + 5.d0*Gr1*(y(191) + y(210) + y(229)) + 15.d0*Gr2*(y(248) + y(267) + y(286) + y(305) + y(324)) - 18.d0*j*root3*Wp*(-y(166) + y(64)))
	dydt(59) = 1.d0/12.d0*(G5p*(root6*y(135) + 2.d0*y(154)) + 2.d0*j*root3*Wp*y(167) + 6.d0*j*BField*uB*y(59))
	dydt(60) = 1.d0/6.d0*(j*root3*Wp*y(168) - (-6*j*dp + 6.d0*gp + 3.d0*G5p + 11.d0*j*BField*uB)*y(60))
	dydt(61) = 1.d0/6.d0*(-(-6*j*dp + 6.d0*gp + 3.d0*G5p + 7.d0*j*BField*uB)*y(61) + j*root3*(Wp*y(169) - Wp*y(55) + Wc2*y(68)))
